import React from 'react';
import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css';
import './Home.scss';
import NavbarComponent from './Navbar';
import { Container, Row , Col} from 'reactstrap';

const HomeComponent=() => {
    return (
        <>
        <NavbarComponent />
        <div id='bg-image'>
            
        <Container >
            <div id="buffer-top"></div>

            <div id="home-text">
            <p id="topic-text">The Wonderful Trip Planner</p>
            <p id="highlight-text">Adventure</p>
            </div>
            
            <div id = 'line-text'></div>
            <p id="detail-text">With Tom & Journey, you can plan your trip anywhere<br />
            at anytime. We help you save budget by showing you<br />the best deal.</p>
            
            </Container>
            
        </div>
        
        </>
        
    );
}

export default HomeComponent;
